import React, { Component } from 'react';
import '../App.css';

class Balloons extends Component {
    render() {
        return (
        <div className="balloons">
            {createTable = () => {
                for (var i=0; i < 15; i++) {
                    <div class={'balloon balloon' + i}></div>
                }
            }}
        </div>
        );
    }
}

export default Balloons
